import LikedItemTypes from "./liked.types";

export const toggleLikedHidden = () => ({
  type: LikedItemTypes.TOGGLE_LIKED_HIDDEN,
});

export const addLikedItem = (item) => ({
  type: LikedItemTypes.ADD_LIKED_ITEM,
  payload: item,
});
